import React from 'react'
import './Product.css'
import items from '../Data'
import Additems from './Additems'
const Product = () => {
  return (
    <>
     <div className="cantainer">
      <dir className='row'>
      {items.map((item,i)=>{

        return (
          <>
          <Additems key={i} id={item.id} title={item.title} description={item.description} imgSrc={item.imgSrc} price={item.price}/>
          </>
        )
      })}
      </dir>
      </div> 
    </>
  )
}

export default Product
